  input: TEXT,F3N,,"The McCaul for Congress committee has removed a $15,000 debt to
    Denis Calabrese Company.  The campaign entered into an agreement with Denis Calabrese
    Company during the 2004 election cycle.  Part of the agreement included a bonus
    to be paid if all of the agreed upon objectives were accomplished.  It has been
    determined that all of the agreed upon objectives were not accomplished.  The
    Denis Calabrese Company has been compensated for the work done for the campaign
    and there is no need for a bonus to be paid.  Both parties have agreed that a
    bonus does not need to be paid and therefore the McCaul for Congress committee
    is removing this debt from its FEC Report because it is no longer a reportable
    debt.  We have sought guidance on this matter from AO-1999-38 and our analyst,
    Michele Grant."
